commits.content:
declare global {
  interface Window {
    gapi: {
      load(
        apiName: string,
        callback: () => void
      ): void;
      auth2: {
        init(params: {
          client_id: string;
          scope: string;
        }): Promise<any>;
        getAuthInstance(): {
          signIn(): Promise<any>;
          signOut(): Promise<any>;
        };
      };
    };
  }
}

export interface GoogleUser {
  getBasicProfile(): {
    getId(): string;
    getName(): string;
    getEmail(): string;
    getImageUrl(): string;
  };
  getAuthResponse(): {
    id_token: string;
    access_token: string;
  };
}

export interface GoogleAuthData {
  googleId: string;
  email: string;
  name: string;
  photoUrl?: string;
  idToken?: string;
}
